import { Component } from "react";

import "./Chat.css"
import ListMessage from './ListMessage/ListMessage';
import SendMessageBar from './SendMessageBar/SendMessageBar';

class Chat extends Component{
    render(){
        return (
            <div className = "chat">
                < ListMessage />
                < SendMessageBar />
            </div>
        )
    }
}

export default Chat
